import React from 'react';

const FlagGr = props => (
  <svg viewBox="0 0 27 18" {...props}>
    <path fill="#0D5EAF" d="M0 0h27v18H0z" />
    <path fill="none" strokeWidth={2} stroke="#FFF" d="M5 0v11M0 5h10m0-2h17M10 7h17M0 11h27M0 15h27" />
  </svg>
);

export default FlagGr;
